INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, "春咲 ひより", 1.4, 1, "お！\nあそこに困ってそうな人発見！", 1001, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", 2, "草野 優衣", 1.4, 1, "大切な人を\n守れるようになりたい…って", 1002, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "少しは磨かれると思いますよ。", "フェンシングを始めてみては？", 2, "士条 怜", 1.4, 1, "キミに必要な集中力と感性が", 1003, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", 2, "穂高 みそぎ", 1.5, 1, "今日はなにして遊ぶ？", 1004, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "私といっしょに…\nいかない？", "風宮あかりです", 2, "風宮 あかり", 1.4, 1, "ねぇ…", 1006, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "食べ物の恨みは怖いのー", "出雲宮子なのー", 2, "出雲 宮子", 1.5, 1, "プリンたべたいのー", 1007, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "いいよ。\n見られることは運命さ…", "ボクは虹村雪。", 2, "虹村 雪", 1.4, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 1008, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", 2, "柊杏奈", 1.4, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1009, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", 2, "姫宮 真歩", 1.5, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1010, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "ここで会ったが\n100年目～！", "衣之咲璃乃です！", 2, "衣之咲 璃乃", 1.4, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 1011, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, "柏崎 初音", 1.4, 1, "ち、超能力って…\n何のことかな～？", 1012, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", 2, "美波 鈴奈", 1.4, 1, "一応カリスマ読モJKやってまっす！", 1016, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", 2, "喜屋武 香織", 1.4, 1, "東京は遊園地みたいなところさー", 1017, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "イオちゃんって呼んでね。", "支倉伊緒です。", 2, "支倉 伊緒", 1.4, 1, "先生って呼ばれるのは\nくすぐったいから", 1018, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, "茜 ミミ", 1.5, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 1020, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", 2, "栗林 くるみ", 1.5, 1, "あの……\nふぇ……", 1021, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "なんてありがとうございます！", "風宮よりです。\nあああああ！", 2, "風宮 より", 1.4, 1, "こんな私に貴重な時間を\n割いていただき、", 1022, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, "北条 綾音", 1.5, 1, "おにいちゃんどこいくの？\nえ？", 1023, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", 2, "天野 すずめ", 1.4, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 1025, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", 2, "倉石 恵理子", 1.4, 1, "あなたは…運命の……\n伴侶……", 1027, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, "佐々木 咲恋", 1.4, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1028, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", 2, "桜井 望", 1.4, 1, "ぇっと…\nキミ、私のこと知らないの?!", 1029, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", 2, "ニノン・ジュベール", 1.4, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 1030, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", 2, "上喜 しのぶ", 1.4, 1, "でもって私の隣にいるのが……\nえ、見えない？", 1031, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！", 2, "野戸まひる", 1.5, 1, "けんども\nそれには足りないモンが…", 1033, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, "綾瀬 ゆかり", 1.4, 1, "ちょっと緊張しちゃって…", 1034, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "これ以上お話しすることは…\nないです！", "氷川鏡華…です", 2, "氷川 鏡華", 1.5, 1, "知らない人とは話しちゃいけないので", 1036, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。", 2, "柏崎 栞", 1.4, 1, "……あ、アラーム。", 1038, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。", 2, "双葉 碧", 1.4, 1, "私、一人も友達がいなくて……", 1040, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "そう思っています。", "三角千歌です。", 2, "三角 千歌", 1.4, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1042, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "う、疑ってすまなかったな…", "安芸真琴だ。", 2, "安芸 真琴", 1.4, 1, "あぁ？\nお前のそいつの仲間か？", 1043, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！", 2, "イリヤ・オーンスタイン", 1.4, 1, "生けとし生ける全ての者よ！", 1044, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "ｌク、クウカに何かご用ですか!?", "そこで騎士は妖精を乱暴に……", 2, "遠見 空花", 1.4, 1, "ぐふふふふ……はっ！", 1045, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, "宮坂たまき", 1.4, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1046, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！", 2, "大神 美冬", 1.4, 1, "それでは早速クエストに…", 1048, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流だよ！", 2, "星野静流", 1.4, 1, "クエストもバトルも\n掃除も洗濯も", 1049, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "アタシは玉泉美咲。", 2, "玉泉美咲", 1.5, 1, "見ての通りの\nセクシー美少女で", 1050, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "？？？？", "？？？", 2, "リマ", 1.4, 1, "？？？？", 1052, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 2, "モニカ・ヴァイスヴィント", 1.5, 1, "菓子でつろうなどと\n稚拙な策を……", 1053, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 2, "ペコリーヌ", 1.5, 1, "菓子でつろうなどと\n稚拙な策を……", 1058, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 2, "コッコロ", 1.5, 1, "菓子でつろうなどと\n稚拙な策を……", 1059, 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 1, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 2, "キャル", 1.5, 1, "菓子でつろうなどと\n稚拙な策を……", 1060, 0);
